{
  "translationLines": [
    {
      "lineNumber": 151231,
      "originalJapaneseLine": "「なに、表が騒がしかったのでね、",
      "translatedEnglishLine": "\"Well, the outside was noisy, you see,\""
    },
    {
      "lineNumber": 151232,
      "originalJapaneseLine": "　私にしては珍しく寝付けなかっただけのこと」",
      "translatedEnglishLine": "I just happened to be unable to fall asleep, which is rare for me.\""
    },
    {
      "lineNumber": 151233,
      "originalJapaneseLine": "「ちっ、いちいちイラッとくる言い回しを……」",
      "translatedEnglishLine": "\"Tch, such irritating phrasing every single time...\""
    },
    {
      "lineNumber": 151234,
      "originalJapaneseLine": "ランスの言葉は無視して、",
      "translatedEnglishLine": "Ignoring Lances' words,"
    },
    {
      "lineNumber": 151235,
      "originalJapaneseLine": "ケッセルリンクはペルエレに視線を送った。",
      "translatedEnglishLine": "Kesselink cast a glance towards Peruere."
    },
    {
      "lineNumber": 151236,
      "originalJapaneseLine": "「フッ……」",
      "translatedEnglishLine": "\"Hmph...\""
    },
    {
      "lineNumber": 151237,
      "originalJapaneseLine": "ケッセルリンクは怒りを表すこともなく、",
      "translatedEnglishLine": "Without showing any anger,"
    },
    {
      "lineNumber": 151238,
      "originalJapaneseLine": "ただ、口元を歪ませて微笑んだ。",
      "translatedEnglishLine": "Kesselink merely twisted the corners of his mouth into a smile."
    },
    {
      "lineNumber": 151239,
      "originalJapaneseLine": "「裏切るのは分かっていた……",
      "translatedEnglishLine": "\"I knew you would betray me...\""
    },
    {
      "lineNumber": 151240,
      "originalJapaneseLine": "　しかし、こうも早いとはな」",
      "translatedEnglishLine": "But I didn't expect it to be so soon.\""
    },
    {
      "lineNumber": 151241,
      "originalJapaneseLine": "「ひいっ！　ばれてた！？」",
      "translatedEnglishLine": "\"Eek! I was found out!?\""
    },
    {
      "lineNumber": 151242,
      "originalJapaneseLine": "「しかし許そう」",
      "translatedEnglishLine": "\"Nevertheless, I will forgive you.\""
    },
    {
      "lineNumber": 151243,
      "originalJapaneseLine": "「……え」",
      "translatedEnglishLine": "\"...Huh?\""
    },
    {
      "lineNumber": 151244,
      "originalJapaneseLine": "「幸せになるがいい」",
      "translatedEnglishLine": "\"Be happy.\""
    },
    {
      "lineNumber": 151245,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 151246,
      "originalJapaneseLine": "「うっせー、あんたに言われんでもなるわ。",
      "translatedEnglishLine": "\"Shut up, I'll be happy whether you say it or not."
    },
    {
      "lineNumber": 151247,
      "originalJapaneseLine": "　勝手に人に同情して傲慢してんじゃないわよ」",
      "translatedEnglishLine": "Don't be arrogant and sympathize with me without permission.\""
    },
    {
      "lineNumber": 151248,
      "originalJapaneseLine": "「フッ」",
      "translatedEnglishLine": "\"Hmph.\""
    },
    {
      "lineNumber": 151249,
      "originalJapaneseLine": "本当に可笑しそうに、",
      "translatedEnglishLine": "Truly as if amused,"
    },
    {
      "lineNumber": 151250,
      "originalJapaneseLine": "ケッセルリンクが口元を歪めた。",
      "translatedEnglishLine": "Kesselink twisted the corners of his mouth."
    },
    {
      "lineNumber": 151251,
      "originalJapaneseLine": "「……そうか」",
      "translatedEnglishLine": "\"...I see.\""
    },
    {
      "lineNumber": 151252,
      "originalJapaneseLine": "「ふんっ、そうよ」",
      "translatedEnglishLine": "\"Hmph, that's right.\""
    },
    {
      "lineNumber": 151253,
      "originalJapaneseLine": "「さあさあ、総統閣下様！？」",
      "translatedEnglishLine": "\"Come on, come on, Führer!?\""
    },
    {
      "lineNumber": 151254,
      "originalJapaneseLine": "ペルエレがランスを",
      "translatedEnglishLine": "Peruere"
    },
    {
      "lineNumber": 151255,
      "originalJapaneseLine": "グイーッと前に突き出した。",
      "translatedEnglishLine": "forcefully pushed Lances forward."
    },
    {
      "lineNumber": 151256,
      "originalJapaneseLine": "「あ、ああ？」",
      "translatedEnglishLine": "\"Ah, uh?\""
    },
    {
      "lineNumber": 151257,
      "originalJapaneseLine": "「こ、これでもう私は裏切り確定！",
      "translatedEnglishLine": "\"T-this makes me a confirmed traitor now!"
    },
    {
      "lineNumber": 151258,
      "originalJapaneseLine": "　あんた絶対あいつ殺しなさいよ！？」",
      "translatedEnglishLine": "You absolutely have to kill that guy!\""
    },
    {
      "lineNumber": 151259,
      "originalJapaneseLine": "「じゃないと私が殺されるからー！」",
      "translatedEnglishLine": "\"Otherwise, I'll be the one killed!\""
    },
    {
      "lineNumber": 151260,
      "originalJapaneseLine": "「お前、少しは情とか湧いとらんのか」",
      "translatedEnglishLine": "\"Don't you feel a little sympathy or something?\""
    },
    {
      "lineNumber": 151261,
      "originalJapaneseLine": "「だがお前に言われるまでもない。",
      "translatedEnglishLine": "\"But I don't need you to tell me that.\""
    },
    {
      "lineNumber": 151262,
      "originalJapaneseLine": "　魔人は倒す、美女以外例外はない」",
      "translatedEnglishLine": "Demons must be defeated, no exceptions unless they're beauties.\""
    },
    {
      "lineNumber": 151263,
      "originalJapaneseLine": "「そして、ケッセルリンクのメイドは",
      "translatedEnglishLine": "\"And all of Kesselink's maids"
    },
    {
      "lineNumber": 151264,
      "originalJapaneseLine": "　全員俺様のものー！　がはははは！」",
      "translatedEnglishLine": "belong to me— gahahahaha!\""
    },
    {
      "lineNumber": 151265,
      "originalJapaneseLine": "「それはいいがな……",
      "translatedEnglishLine": "\"That's all well and good, but..."
    },
    {
      "lineNumber": 151266,
      "originalJapaneseLine": "　ちっ、ケッセルリンクが相手となると……」",
      "translatedEnglishLine": "Tch, facing Kesselink as an opponent..."
    },
    {
      "lineNumber": 151267,
      "originalJapaneseLine": "「いや、よく見ろ」",
      "translatedEnglishLine": "\"No, look closely.\""
    },
    {
      "lineNumber": 151268,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 151269,
      "originalJapaneseLine": "「さしものケッセルリンクと言えど、",
      "translatedEnglishLine": "\"Even Kesselink, as formidable as he is,"
    },
    {
      "lineNumber": 151270,
      "originalJapaneseLine": "　昼間の今はパワーダウンしているようだ」",
      "translatedEnglishLine": "seems to be weakened during the daytime now.\""
    },
    {
      "lineNumber": 151271,
      "originalJapaneseLine": "「本来の力が発揮できない今なら……」",
      "translatedEnglishLine": "\"If it's when he can't show his true power...\""
    },
    {
      "lineNumber": 151272,
      "originalJapaneseLine": "「心の友！　一気にやったれ！」",
      "translatedEnglishLine": "\"My comrade! Let's finish this in one go!\""
    },
    {
      "lineNumber": 151273,
      "originalJapaneseLine": "「当然だ！",
      "translatedEnglishLine": "\"Of course!"
    },
    {
      "lineNumber": 151274,
      "originalJapaneseLine": "　おおおおおお、これで決着だぁぁーー！」",
      "translatedEnglishLine": "Ooooooo, this is the end!\""
    },
    {
      "lineNumber": 151275,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 151276,
      "originalJapaneseLine": "「来い！」",
      "translatedEnglishLine": "\"Come!\""
    },
    {
      "lineNumber": 151277,
      "originalJapaneseLine": "「がはははははははははははは！」",
      "translatedEnglishLine": "\"Gahahahahahahahahaha!\""
    },
    {
      "lineNumber": 151278,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 151279,
      "originalJapaneseLine": "ケッセルリンクがその場に膝をつく。",
      "translatedEnglishLine": "Kesselink dropped to his knees on the spot."
    },
    {
      "lineNumber": 151280,
      "originalJapaneseLine": "カオスによってつけられた",
      "translatedEnglishLine": "Marked by Chaos,"
    }
  ]
}

